paths:
  tmp0:
    post:
      description: Lookup events in AWS CloudTrail
      parameters:
      - description: The attribute key to search for
        example: UserName
        in: query
        name: Attribute Key
        required: true
        schema: {type: string}
      - description: The value of the attribute key to search for
        example: root
        in: query
        name: Attribute Value
        required: true
        schema: {type: string}
      - description: The start time of your search
        example: '2019-07-01T17:28:39Z'
        in: query
        name: Start Time
        required: false
        schema: {type: string}
      - description: The end time of your search
        example: 2019-07-020T17:28:39Z
        in: query
        name: End Time
        required: false
        schema: {type: string}
      - description: Maximum number of results to return
        example: '13'
        in: body
        name: max_results
        required: false
        schema: {type: string}
      responses:
        '200':
          content:
            application/json:
              schema: {$ref: '#/components/schemas/tmp0'}
          description: Successful request
      summary: AWS CloudTrail Lookup Events
  tmp1:
    post:
      description: Retrieve AWS CloudWatch Logs Events
      parameters:
      - description: The Log Group to get loge events from
        example: /aws/lambda/apphub-bundles
        in: query
        name: Log Group
        required: true
        schema: {type: string}
      - description: The log stream to get log events from
        example: 2018/12/04/[$LATEST]d53f6d4b5fe14daa80dcdaab92c5c2a5
        in: query
        name: Log Stream
        required: true
        schema: {type: string}
      - description: Milliseconds in epoch/unix time
        example: '1562078646'
        in: body
        name: Start Time
        required: false
        schema: {type: string}
      - description: Milliseconds in epoch/unix time
        example: '1562078646'
        in: body
        name: End Time
        required: false
        schema: {type: string}
      - description: The maximum number of log events returned
        example: '100'
        in: body
        name: Limit
        required: false
        schema: {type: string}
      - description: If true, earliest log events are returned first
        example: 'True'
        in: query
        name: Start From Head
        required: false
        schema: {type: boolean}
      responses:
        '200':
          content:
            application/json:
              schema: {$ref: '#/components/schemas/tmp1'}
          description: Successful request
      summary: AWS CloudWatch Logs Get Log Events
  tmp10:
    post:
      description: Retrieve AWS Config compliance summary by resource type
      parameters:
      - description: The type of AWS resource
        example: AWS::EC2::Instance
        in: query
        name: Resource Type
        required: true
        schema: {type: string}
      responses:
        '200':
          content:
            application/json:
              schema: {$ref: '#/components/schemas/tmp10'}
          description: Successful request
      summary: AWS Config Get Compliance Summary By Resource Type
  tmp11:
