      description: Retrieve a list of AWS Config rules
      parameters: []
      responses:
        '200':
          content:
            application/json:
              schema: {$ref: '#/components/schemas/tmp12'}
          description: Successful request
      summary: AWS Config Get Config Rules
  tmp13:
