        name: Resource Type
        required: true
        schema: {type: string}
      responses:
        '200':
          content:
            application/json:
              schema: {$ref: '#/components/schemas/tmp13'}
          description: Successful request
      summary: AWS Config List Resources
  tmp14:
    post:
      description: Retrieve AWS Cost cost and usage for a specified time period
      parameters:
      - description: The beginning of the time period you want usage and costs for
        example: '2019-01-01'
        in: query
        name: Start Day
        required: true
        schema: {type: string}
      - description: The end of the time period you want usage and costs for
        example: '2019-06-01'
        in: query
        name: End Day
        required: true
        schema: {type: string}
      - description: Sets the AWS cost granularity to MONTHLY or DAILY
        example: DAILY
        in: query
        name: Granularity
        required: false
        schema: {type: string}
      - description: Which metrics are returned in the query. Valid values are AmortizedCost,BlendedCost,NetAmortizedCost,NetUnblendedCost,NormalizedUsageAmount,UnblendedCost,UsageQuantity
        example: NetAmortizedCost
        in: query
        name: Metrics
        required: false
        schema: {type: string}
      responses:
        '200':
          content:
            application/json:
              schema: {$ref: '#/components/schemas/tmp14'}
          description: Successful request
      summary: AWS Cost Get Cost and Usage
  tmp15:
    post:
      description: Blacklist an IP using EC2 Network ACLs
      parameters:
