          description: Successful request
      summary: AWS EC2 Create Security Group
  tmp17:
    post:
      description: Create a AWS EC2 Traffic Mirror Filter
      parameters:
      - description: The description of the Traffic Mirror rule.
        example: 443-444
        in: query
        name: Description
        required: false
        schema: {type: string}
      - description: The type of resource to tag. Currently, the resource types that
          support tagging on creation are fleet,dedicated-host,instance,snapshot,volume
        example: instance
        in: query
        name: Resource Type
        required: false
        schema: {type: string}
      - description: The key of the tag
        example: Example Key
        in: query
        name: Tag Key
        required: false
        schema: {type: string}
      - description: The value of the tag
        example: Example Value
        in: query
        name: Tag Value
        required: false
        schema: {type: string}
      - description: Checks whether you have the required permissions for the action
        example: 'True'
        in: query
        name: Dry Run
        required: false
        schema: {type: boolean}
      responses:
        '200':
          content:
            application/json:
              schema: {$ref: '#/components/schemas/tmp17'}
          description: Successful request
      summary: AWS EC2 Create Traffic Mirror Filter
  tmp18:
