        name: Traffic Mirror Filter ID
        required: true
        schema: {type: string}
      - description: The type of traffic (ingress | egress ).
        example: ingress
        in: query
        name: Traffic Direction
        required: true
        schema: {type: string}
      - description: The number of the Traffic Mirror rule
        example: '123'
